import { createStackNavigator } from '@react-navigation/stack';
import React from 'react';
import DeliveryTimingScreen from '../../scenes/cart/deliveryTiming.component';

const Stack = createStackNavigator();

export const DeliveryTimingNavigator = (): React.ReactElement => (
  <Stack.Navigator headerMode='none'>
    <Stack.Screen name='DeliveryTiming' component={DeliveryTimingScreen} />
  </Stack.Navigator>
);
